import React from "react";
import {Link} from "react-router-dom";
import {Stack} from "@mui/material";
import Logo from "../Assests/Image/Logo.jpg";

const Navbar=()=>{
    return(
        <Stack 
        direction='row'
        // justifyContent="space-around"
        sx={{gap:{sm:'122px',xs:'40px'} ,mt:{ls:'0',sm:'32px',xs:'20px'}}}
        >
            <Link to="/">
                <img src={Logo} alt="logo" style={{width:'80px', height:'80px',margin:'0 0px'}}/>
            </Link>
            <Stack
            direction='row'
            gap='20px'
            fontSize='20px'
            alignItems='flex-end'
            >
                <Link to="/" style={{textdDecoration:'none',color:"#3A1212",borderbottom:'3px solid #FF2625'}}>Home</Link>
                <a href="#exercises" style={{textDecoration:'none',color:'#3a1212'}}>Exercises</a>
            </Stack>
        </Stack>
    )
}

export default Navbar;
